<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8">
  <title>Speauty Docs</title>
  <meta http-equiv="X-UA-Compatible" content="IE=edge,chrome=1" />
  <meta name="description" content="Description">
  <meta name="viewport" content="width=device-width, user-scalable=no, initial-scale=1.0, maximum-scale=1.0, minimum-scale=1.0">
  <link rel="stylesheet" href="./assets/vue.css">
</head>
<body>
  <div id="app">

  </div>
  <script>
    window.$docsify = {
      name: 'Speauty',
      repo: 'https://github.com/speauty/speauty.github.io/',
      loadSidebar: true,
      subMaxLevel: 5,
      alias: {
        '/.*/_sidebar.md': '/_sidebar.md'
      },
      loadNavbar: true,
      coverpage: true,
      onlyCover: true,
      auto2top: true
    }
  </script>
  <script src="./assets/docsify.min.js"></script>
  <script src="assets/prism/prism-bash.min.js"></script>
  <script src="assets/prism/prism-php.min.js"></script>
  <script src="assets/prism/prism-php-extras.min.js"></script>
  <script src="assets/prism/prism-sql.min.js"></script>
  <script>
    if (typeof navigator.serviceWorker !== 'undefined') {
      navigator.serviceWorker.register('/assets/sw.js')
    }
  </script>
</body>
</html>
